        if (event.keyCode === 13) {
            event.preventDefault();
            dispatch(setCheckedCategories(state.checkedCategories));
        }
    };

    return (
        <form>
            <input
                placeholder="Поиск"
                value={text}
                onChange={(e) => { setText(e.target.value) }}
                onKeyDown={(e) => enterDown(e)} />
        </form>
    )
}
